#Initialclass Solution:    def firstUniqChar(self, s: str) -> int:        if len(s) <= 1:            return 0                freq = {}        ind = {}        res = 100001                for i in range(len(s)):            freq[s[i]] = freq.get(s[i], 0) + 1            ind[s[i]] = i                for key, value in freq.items():            if value <= 1 and ind[key] < res:                res = ind[key]                if res > 100000:            return -1        return res        #findclass Solution:    def firstUniqChar(self, s: str) -> int:        res = 100001        for i in (s):           ind = s.find(i)           if ind == s.rfind(i):               res = min(res, ind)        return res if res <100001 else -1    #faster looping on 26 alphabetsclass Solution:    def firstUniqChar(self, s: str) -> int:        res = 100001        for i in set(s):           ind = s.find(i)           if ind == s.rfind(i):               res = min(res, ind)        return res if res <100001 else -1        print(Solution().firstUniqChar("")) 